* {
  margin: 0; padding: 0;
  font-family: 'Noto Sans KR', sans-serif;
  color: #333;
}
li {list-style: none;}
a {color: #333; text-decoration: none;}
img {display: block;}

@import url('https://fonts.googleapis.com/css2?family=Noto+Sans+KR&display=swap');


/*-------- header01 --------*/
.header .header01 {
  width: 1240px; height: 60px;
  margin: 0 auto;
  position: relative;
}
.header .header01::after {
  content: '';
  display: block;
  clear: both;
}


.header01 .ssg_logo {
  width: 150px; height: 60px;
  float: left;
  position: relative;
}
.header01 .ssg_logo img {
  width: 150px; height: 60px;
}
.header01 .ssg_logo img:hover {
  cursor: pointer;
}

#ssg_chk {display: none;}
#ssg_chk:checked ~ .ssg_brand {display: block;}
#ssg_chk ~ .ssg_brand {display: none;}

.header01 .ssg_logo .ssg_brand {
  width: 235px; height: 240px;
  background-color: white;
  border: 1px solid #ccc; box-sizing: border-box;
  border-radius: 20px;  
  position: absolute;
  top: 10px; left: 12px;
  z-index: 30;
}
.header01 .ssg_logo .ssg_brand .ssg {
  width: 205px; height: 30px;
  font-size: 20px;
  line-height: 30px;
  margin: 23px 0 0 15px;
  overflow: hidden;
}
.header01 .ssg_logo .ssg_brand label {
  width: 30px; height: 30px;
  text-align: center;
  line-height: 30px;
  float: right;
}
.header01 .ssg_logo .ssg_brand label:hover {
  cursor: pointer;
}
.header01 .ssg_logo .ssg_brand .brand_li > ul:first-child {
  width: 100px;
  margin: 10px 0 0 15px;
  float: left;
}
.header01 .ssg_logo .ssg_brand .brand_li > ul:nth-child(2) {
  width: 90px;
  margin: 10px 0 0 15px;
  float: left;
}
.header01 .ssg_logo .ssg_brand .brand_li li {
  font-size: 14px;
  margin: 10px 0;
}
.header01 .ssg_logo .ssg_brand .brand_li li:hover {
  font-weight: bold;
  cursor: pointer;
}


.header01 .rank {
  width: 150px; height: 35px;
  background-color: white;
  box-sizing: border-box;
  border-radius: 5px;
  font-size: 12px;
  font-weight: bold;
  line-height: 35px;
  position: absolute;
  top: 15px; left: 170px;
  overflow: hidden;
  animation-name: rank_box;
  animation-duration: 3s;
  animation-iteration-count: infinite;
}

@keyframes rank_box {
  0% {border: 1px solid rgb(236, 48, 142);} 
  20% {border: 1px solid rgb(56, 142, 255);}
  40% {border: 1px solid rgb(231, 72, 72);} 
  60% {border: 1px solid rgb(218, 205, 89);} 
  80% {border: 1px solid rgb(214, 114, 0);} 
  100% {border: 1px solid rgb(236, 48, 142);} 
}

.header01 .rank ul {
  width: 150px; height: 350px;
  position: absolute;
  top: 0; left: 10px;
  animation-name: top;
  animation-duration: 30s;
  animation-iteration-count: infinite;
}
.header01 .rank ul li {
  width: 150px; height: 35px;
}

@keyframes top {
  0% {top: 0;}
  2% {top: -35px;}
  10% {top: -35px;}
  12% {top: -70px;}
  20% {top: -70px;}
  22% {top: -105px;}
  30% {top: -105px;}
  32% {top: -140px;}
  40% {top: -140px;}
  42% {top: -175px;}
  50% {top: -175px;}
  52% {top: -210px;}
  60% {top: -210px;}
  62% {top: -245px;}
  70% {top: -245px;}
  72% {top: -280px;}
  80% {top: -280px;}
  82% {top: -315px;}
  90% {top: -315px;}
  92% {top: -350px;}
  100% {top: -350px;}
}


.header01 .gnb {
  height: 60px;
  float: right;
}
.header01 .gnb ul {
  height: 60px;
  font-size: 0;
  float: left;
}
.header01 .gnb ul:first-child {
  margin-right: 10px;
}
.header01 .gnb ul li {
  display: inline-block;
  height: 60px;
  font-size: 11px;
  text-align: center;
  line-height: 60px;
}
.header01 .gnb ul:first-child li {
  margin-left: 7px;
}
.header01 .gnb ul:last-child li {
  margin-left: 10px;
}
.header01 .gnb ul a {display: block;}


/*-------- header02 --------*/
.header .header02_box {
  height: 85px;
  background-color: #ffd140;
}
.header .header02_box .header02 {
  width: 1240px; height: 85px;
  margin: 0 auto;
  overflow: hidden;
  position: relative;
}


.header02 .emart_logo {
  width: 190px; height: 85px;
  background-color: #ffd140;
  float: left;
}


.header02 .search_box {
  width: 230px; height: 35px;
  position: absolute;
  top: 25px; left: calc(50% - 115px);
}
.header02 .search_box .search {
  width: 195px; height: 35px;
  outline: none;
  border: 1px solid #333; box-sizing: border-box;
  font-size: 12px;
  padding-left: 10px;
  padding-right: 10px;
  float: left;
}
#submit {display: none;}
.header02 .search_box img {
  width: 35px; height: 35px;
  background-color: #333;
  float: left;
}
.header02 .search_box img:hover {
  cursor: pointer;
}


/*-------- header03 --------*/
.header .header03_box {
  height: 50px;
  background-color: #333;
}
.header .header03_box .header03 {
  width: 1240px; height: 50px;
  margin: 0 auto;
}


.header03 {
  width: 1240px;
  margin: 0 auto;
  position: relative;
}
.header03::after {
  content: '';
  display: block;
  clear: both;
}


/*-------- header03 lnb01 --------*/
#ham_btn {display: none;}
#ham_btn:checked ~ .ham_menu {display: block;}
#ham_btn ~ .ham_menu {display: none;}

.header03 .lnb01 {
  width: 190px; height: 50px;
  background-color: #292a2e;
  line-height: 50px;
  padding-left: 10px;
  box-sizing: border-box;
  float: left;
}
.lnb01 .ham_label {
  width: 190px; height: 50px;
}
.lnb01 .ham_label:hover {
  cursor: pointer;
}
.lnb01 .ham_label img {
  width: 35px; height: 50px;
  margin: 0 6px;
  float: left;
}
.lnb01 .ham_label p {
  font-size: 14px;
  color: white;
  float: left;
}
.lnb01 .ham_menu {
  width: 1240px;
  position: absolute;
  top: 50px; left: 0;
  z-index: 20;
}


#food, #life {display: none;}
#food:checked ~ .food_sheet {display: block;}
#food ~ .food_sheet {display: none;}
#life:checked ~ .life_sheet {display: block;}
#life ~ .life_sheet {display: none;}

.lnb01 .ham_menu .ham_menu_label {
  width: 1240px; height: 55px;
  background-color: #ddd;
  border-left: 1px solid #333;
  border-right: 1px solid #333;
  border-bottom: 1px solid #333;
  box-sizing: border-box;
  font-size: 0;
}
.lnb01 .ham_menu .ham_menu_label label {
  display: inline-block;
  width: 20%; height: 55px;
  border-right: 1px solid #333;
  box-sizing: border-box;
  font-size: 18px;
  font-weight: bold;
  text-align: center;
  line-height: 55px;
}
.lnb01 .ham_menu .ham_menu_label label:hover {
  cursor: pointer;
}

#food:checked ~ .ham_menu_label .food_label,
#life:checked ~ .ham_menu_label .life_label {
  background-color: white;
  border-bottom: 0;
}


.lnb01 .ham_menu .sheet {
  width: 1240px;
  background-color: white;
  border-left: 1px solid #333;
  border-right: 1px solid #333;
  border-bottom: 1px solid #333;
  box-sizing: border-box;
  padding-top: 3px;
  overflow: hidden;
}
.lnb01 .ham_menu .food_sheet {
  height: 1340px;
}
.lnb01 .ham_menu .life_sheet {
  height: 1120px;
}

.ham_menu .sheet .title {
  width: 1200px; height: 40px;
  border-bottom: 1px solid #333;
  box-sizing: border-box;
  margin: 0 20px;
}
.ham_menu .sheet .title li {
  width: 240px; height: 40px;
  font-size: 14px;
  font-weight: bold;
  line-height: 40px;
  margin-bottom: 10px;
  padding-left: 15px;
  box-sizing: border-box;
  float: left;
}

.ham_menu .sheet .list {
  width: 1200px;
  border-bottom: 1px solid #333;
  box-sizing: border-box;
  margin: 0 20px;
}
.ham_menu .sheet .list a {display: block;}
.ham_menu .sheet .food_list01 {height: 345px;}
.ham_menu .sheet .food_list02 {height: 265px;}
.ham_menu .sheet .food_list03 {height: 305px;}
.ham_menu .sheet .food_list04 {height: 270px; border-bottom: 0;}

.ham_menu .sheet .life_list01 {height: 305px;}
.ham_menu .sheet .life_list02 {height: 305px;}
.ham_menu .sheet .life_list03 {height: 385px; border-bottom: 0;}

.ham_menu .sheet .list ul {width: 240px; float: left;}
.ham_menu .sheet .list li {
  width: 240px; height: 20px;
  font-size: 14px;
  font-weight: normal;
  line-height: 20px;
  padding-left: 15px;
  box-sizing: border-box;
}
.ham_menu .sheet .list li:hover {background-color: #e45d32; font-weight: bold;}
.ham_menu .sheet .list li:hover a {color: white;}


/*-------- header03 lnb02 --------*/
.header03 .lnb02 {
  position: relative;
}
.header03 .lnb02 ul {
  width: 800px; height: 50px;
  font-size: 0;
  float: left;
  line-height: 50px;
}
.header03 .lnb02 ul li {
  display: inline-block;
  font-size: 14px;
  color: white;
  margin-left: 35px;
}
.header03 .lnb02 ul li a {color: white;}
.header03 .lnb02 ul li i {color: white;}
.header03 .lnb02 ul li:hover {cursor: pointer;}
.header03 .lnb02 ul li:hover a,
.header03 .lnb02 ul li:hover i {color: #ffd140;}

.header03 .lnb02 .brand_sheet {
  display: none;
  background-color: white;
  width: 150px; height: 240px;
  border: 1px solid #ccc; box-sizing: border-box;
  border-radius: 10px;
  overflow: hidden;
  position: absolute;
  top: 45px; left: 763px;
  z-index: 21;
}
.header03 .lnb02 .brand_sheet li {
  display: block;
  width: 150px; height: 40px;
  line-height: 40px;
  margin: 0;
  padding-left: 20px;
  box-sizing: border-box;
}
.header03 .lnb02 .brand_sheet li a {
  display: block;
  color: #333;
}
.header03 .lnb02 .brand_sheet li:last-child {
  background-color: #333;
}
.header03 .lnb02 .brand_sheet li:last-child a {
  color: white;
}
.header03 .lnb02 .brand_sheet li:hover {
  background-color: #eee;
}
.header03 .lnb02 .brand_sheet li:hover a {
  font-weight: 500;
  color: #333;
}
.header03 .lnb02 .brand_sheet li:last-child:hover {
  background-color: #292a2e;
}
.header03 .lnb02 .brand_sheet li:last-child:hover a {
  font-weight: 400;
  color: #ffd140;
}


/*-------- header03 delivery --------*/
.header03 .delivery a {
  display: block;
  width: 250px; height: 50px;
  background-color: #292a2e;
  border: 1px solid #333; box-sizing: border-box;
  font-size: 14px;
  color: #ffd140;
  text-align: center;
  line-height: 50px;
  float: right;
}
.header03 .delivery i {color: #ffd140;}

.header03 .delivery_sheet {
  display: none;
  width: 250px; height: 100px;
  background-color: white;
  border: 1px solid #ccc; box-sizing: border-box;
  border-radius: 10px;
  font-size: 14px;
  text-align: center;
  position: absolute;
  top: 45px; left: 990px;
  z-index: 21;
}
.header03 .delivery_sheet p {
  margin-top: 15px;
  margin-bottom: 8px;
}
.header03 .delivery_sheet a {
  display: block;
  width: 80px; height: 25px;
  background-color: #333;
  border-radius: 5px;
  font-size: 12px;
  color: white;
  line-height: 23px;
  margin-left: 85px;
}
.header03 .delivery_sheet a:hover {
  background-color: #292a2e;
  color: #ffd140;
}


/*-------- visual_main_box --------*/
.visual_main_box {
  animation-name: visual_color;
  animation-duration: 30s;
  animation-iteration-count: infinite;
}

@keyframes visual_color {
  0% {background-color: #F9EFB4;}
  10% {background-color: #F9EFB4;}
  20% {background-color: #F2F2F2;}
  30% {background-color: #F2F2F2;}
  40% {background-color: #F6E6D7;}
  50% {background-color: #F6E6D7;}
  60% {background-color: #F8F3B1;}
  70% {background-color: #F8F3B1;}
  80% {background-color: #FAD9B0;}
  90% {background-color: #FAD9B0;}
  100% {background-color: #F9EFB4;}
}


.visual_main_box .visual_main {
  width: 1240px; height: 570px;
  margin: 0 auto;
  position: relative;
}


.visual_main .lnb_menu {
  width: 190px; height: 570px;
  background-color: rgba(0, 0, 0, 0.05);
  padding: 5px 0;
  box-sizing: border-box;
  position: absolute;
  top: 0; left: 0;
  z-index: 10;
}
.visual_main .lnb_menu::after {
  content: '';
  display: block;
  clear: both;
}
.visual_main .lnb_menu .menu h4 {
  padding: 3px 0 1px 20px;
  box-sizing: border-box;
}
.visual_main .lnb_menu .menu>li {
  margin-right: 20px;
  position: relative;
}
.visual_main .lnb_menu .menu a {
  display: block;
  font-size: 12px;
  font-weight: normal;
  box-sizing: border-box;
  padding-left: 20px;
}
.visual_main .lnb_menu .menu li:hover {
  background-color: #333;
}
.visual_main .lnb_menu .menu li:hover>a {
  font-weight: bold;
  color: white;
}


.visual_main .lnb_menu .menu .category {display: none;}
.visual_main .lnb_menu .menu li:hover .category {display: block;}


.visual_main .lnb_menu .category {
  width: 200px;
  background-color: white;
  border: 1px solid #333;
  box-sizing: border-box;
  padding: 10px;
  position: absolute;
  left: 170px; top: 0;
}
.visual_main .lnb_menu .category li a {
  display: block;
  font-size: 12px;
  color: #666;
  padding: 2px 0;
  box-sizing: border-box;
}


.visual_main .visual_img {
  width: 1050px; height: 570px;
  position: absolute;
  top: 0; right: 0;
  z-index: 1;
  animation-name: visual_img;
  animation-duration: 30s;
  animation-iteration-count: infinite;
}

@keyframes visual_img {
  0% {background-image: url(./images/visual_main_01.jpg)}
  10% {background-image: url(./images/visual_main_01.jpg)}
  20% {background-image: url(./images/visual_main_02.jpg)}
  30% {background-image: url(./images/visual_main_02.jpg)}
  40% {background-image: url(./images/visual_main_03.jpg)}
  50% {background-image: url(./images/visual_main_03.jpg)}
  60% {background-image: url(./images/visual_main_04.jpg)}
  70% {background-image: url(./images/visual_main_04.jpg)}
  80% {background-image: url(./images/visual_main_05.jpg)}
  90% {background-image: url(./images/visual_main_05.jpg)}
  100% {background-image: url(./images/visual_main_01.jpg)}
}


/*-------- obanjang_box --------*/
.obanjang_box {
  width: 1240px;
  margin: 50px auto;
  overflow: hidden;
}
.obanjang_box .title {
  font-size: 24px;
  font-weight: bold;
  text-align: center;
  margin: 15px 0 8px; 
}
.obanjang_box .sub_title {
  font-size: 14px;
  font-weight: bold;
  color: #666;
  text-align: center;
  margin-bottom: 20px;
}
.obanjang_box .product_box>li {
  width: 295px; height: 470px;
  margin-right: 20px;
  float: left;
}
.obanjang_box .product_box>li:last-child {margin-right: 0;}
.obanjang_box .product_box .img {
  width: 295px; height: 350px;
  margin-bottom: 10px;
  overflow: hidden;
}
.obanjang_box .product_box .img:hover img {transform: scale(1.02)}
.obanjang_box .product_box .img img {
  display: block;
  width: 295px; height: 350px;
}
.obanjang_box .product_box .text {
  width: 295px; height: 110px;
  font-size: 0;
}
.obanjang_box .product_box .text li {font-size: 12px;}
.obanjang_box .product_box .text .emart_mall {
  display: inline-block;
  width: 55px; height: 20px;
  background-color: #ffd140;
  font-weight: bold;
  text-align: center;
  line-height: 20px;
  margin-right: 5px;
  margin-bottom: 5px;
}
.obanjang_box .product_box .text li:nth-child(2) {display: inline-block;}
.obanjang_box .product_box .text .price {
  display: inline-block;
  font-size: 20px;
  font-weight: bold;
  margin-right: 2px;
}
.obanjang_box .product_box .text .won {display: inline-block;}


/*-------- wide_banner01 --------*/
.wide_banner01 {
  width: 1240px; height: 100px;
  margin: 0 auto 50px;
}
.wide_banner01 img {width: 1240px; height: 100px;}


/*-------- hit --------*/
.hit {
  width: 1240px; height: 510px;
  margin: 0 auto 50px;
}
.hit .title {
  width: 1240px; height: 100px;
  font-size: 24px;
  font-weight: bold;
  text-align: center;
  line-height: 100px;
  margin-bottom: 20px;
}
.hit .img_box {
  width: 1240px; height: 390px;
  overflow: hidden;
}
.hit .img_box>div {float: left;}
.hit .img_box .img_left,
.hit .img_box .img_right {
  width: 295px; height: 390px;
}
.hit .img_box .img_left img,
.hit .img_box .img_right img {
  width: 295px; height: 135px;
  overflow: hidden;
}
.hit .img_box .img_mid {
  width: 610px; height: 390px;
  margin: 0 20px;
}
.hit .img_box .img_mid img {
  width: 610px; height: 280px;
  overflow: hidden;
}


.hit .img_box .text {
  width: 295px; height: 50px;
  background-color: rgba(224, 224, 224, 0.137);
  border: 1px solid #ccc; box-sizing: border-box;
  margin-bottom: 20px;
  padding: 3px 0 5px 20px;
  box-sizing: border-box;
}
.hit .img_box .text01 {font-size: 14px;}
.hit .img_box .text02 {
  font-size: 12px;
  color: #999;
}
.hit .img_box .text:hover {
  background-color: rgba(224, 224, 224, 0.4);
  cursor: pointer;
}

.hit .img_box .text_big {
  width: 610px; height: 110px;
  background-color: rgba(224, 224, 224, 0.137);
  border: 1px solid #ccc; box-sizing: border-box;
  padding: 15px 0 0 30px;
  box-sizing: border-box;
}
.hit .img_box .text_big li:first-child {
  font-size: 12px;
  font-weight: bold;
  color: #e45d32;
  margin-bottom: 5px;
}
.hit .img_box .text_big .text_big01 {font-size: 18px;}
.hit .img_box .text_big .text_big02 {
  font-size: 12px;
  color: #666;
}
.hit .img_box .text_big:hover {
  background-color: rgba(224, 224, 224, 0.4);
  cursor: pointer;
}


/*-------- list_box --------*/
.list_box {
  width: 1240px;
  margin: 50px auto;
  overflow: hidden;
}
.list_box .title {
  width: 1240px; height: 100px;
  font-size: 24px;
  font-weight: bold;
  text-align: center;
  line-height: 100px;
  margin-bottom: 20px;
}
.list_box .product_box>li {
  width: 295px; height: 470px;
  margin-right: 20px;
  float: left;
}
.list_box .product_box>li:last-child {margin-right: 0;}
.list_box .product_box .img {
  width: 295px; height: 350px;
  margin-bottom: 10px;
  overflow: hidden;
}
.list_box .product_box .img:hover img {transform: scale(1.02)}
.list_box .product_box .img img {
  display: block;
  width: 295px; height: 350px;
}
.list_box .product_box .text {
  width: 295px; height: 110px;
  font-size: 0;
}
.list_box .product_box .text li {font-size: 12px;}
.list_box .product_box .text .emart_mall {
  display: inline-block;
  width: 55px; height: 20px;
  background-color: #ffd140;
  font-weight: bold;
  text-align: center;
  line-height: 20px;
  margin-right: 5px;
  margin-bottom: 5px;
}
.list_box .product_box .text .ssg {
  display: inline-block;
  width: 80px; height: 20px;
  background-color: rgb(173, 33, 33);
  color: white;
  text-align: center;
  line-height: 20px;
}
.list_box .product_box .text .fresh {
  display: inline-block;
  color: red;
}
.list_box .product_box .text .name {
  font-size: 14px;
  font-weight: 500;
}
.list_box .product_box .text .price {
  display: inline-block;
  font-size: 20px;
  font-weight: bold;
  margin-right: 2px;
}
.list_box .product_box .text .won {display: inline-block;}


/*-------- wide_banner_02_box --------*/
.wide_banner_02_box {
  width: 100%; height: 150px;
  background-color: #FFF7B2;
  margin-bottom: 50px;
}
.wide_banner_02_box .wide_banner_02 {
  width: 1240px; height: 150px;
  margin: 0 auto;
  overflow: hidden;
  animation-name: wide_banner;
  animation-duration: 10s;
  animation-iteration-count: infinite;
